(function (module) {

  'use strict';

  console.log("hello");

  module
  .config($routeProvider => {
      $routeProvider
          .when("/", {
              templateUrl: "partials/guides.html",
              controller: "RoutesCtrl"
          })
          .otherwise('/');
  });

}) (angular.module ('funWithRoutes', ['ngRoute']));



